// src/services/api.ts
import axios from "axios";

const API_KEY = "b7b77702-b4ec-4960-b3f7-7d40e44cf5f4";
const API_URL = "https://red-candidate-web.azurewebsites.net";

export const api = axios.create({
  baseURL: API_URL,
  headers: {
    ApiKey: API_KEY,
  },
});

export const fetchOrders = () => api.get("/orders");
export const createOrder = (order: any) => api.post("/orders", order);
export const deleteOrder = (id: string) => api.delete(`/orders/${id}`);
